import React from 'react';
import {Route, Switch,Link} from 'react-router-dom';

import HomePage from './pages/homepage/homepage.component';
const HatsPage = ()=>(
  <div>
    <h1>HATS PAGE</h1>
  </div>
)
const HatsPrice = (props)=>{
  console.log(props);
  return(<div>
    <h1> Hats price page</h1>
    <Link to = {`${props.match.url}/12`}>12</Link>
  </div>)
  }
  const idPage = (props)=>{
    console.log(props);
    return(
      <div>
        <h1>{props.match.params.hatId}</h1>
      </div>
    )
  }
function App() {
  return (

    <div className="App">
    <Switch>
        <Route exact path = "/" component = {HomePage}/>
        <Route exact path = "/hats" component = {HatsPrice}/>
        <Route path = "/hats/:hatId" component = {idPage}/>
    </Switch>    
    </div>
  );
}

export default App;
